import React from 'react';
import {Link} from 'react-router-dom';
// Styles
import './SideBar.css';

export const SideBar = () => {
  let clubs = ['test', 'test2', 'test3', 'test4', 'test5'];
  let clubsUsed = [];
  while (clubsUsed.length !== 6) {
    let selectedClub = clubs[Math.floor(Math.random() * clubs.length)];

    if (clubsUsed.includes(selectedClub)) {
      continue;
    } else {
      clubsUsed.push(selectedClub);
    }

  }
  return (
    <div>
      {clubsUsed.map(club => {
        switch (club) {
          case 'test':
            return <p><Link to='/'>Test</Link></p>;
          break;
          case 'test2':
            return <p><Link to='/contact'>Test 2</Link></p>;
          break;
          case 'test3':
            return <p><Link to='/join'>Test 3</Link></p>;
          break;
          case 'test4':
            return <p><strong>Test 4</strong></p>;
          break;
          case 'test5':
            return <p><em>Test 5</em></p>;
          break;
          default:
            return <p>Looks like an oopsie happened!</p>;
          break
        }
      })}
    </div>
  );
}
